const Menu = () => {
    return (
        <div>
            <ul>
                <li><a src="/">Home</a></li>
                <li><a src="/sobre">Sobre</a></li>
                <li><a src="/contato">Contato</a></li>
            </ul>
        </div>
    );
}

export default Menu;
